    #Utilitaire pour construction des zones de référence
    def makeZoneRef(self) -> None:
        oDstList:list = []
        oPoint:dict = {}
        appPath = bpaTools.getFilePath(__file__)
        inputPath = appPath + "../input/_georef/"
        
        #Format d'entrée: fichier JSON extrait d'une 'Task' - http://xcglobe.com/ways
        sName = "French-Ext"         #French, French-Ext, Corse; LaReunion; Tahiti; GuyaneFr etc ../..
        sFile = inputPath + sName + ".json"
        
        oSrcJson:dict = bpaTools.readJsonFile(sFile)
        for oPoint in oSrcJson["points"]:
            oDstList.append([oPoint["lng"], oPoint["lat"]])
        print("self.a" + sName + " = " + str(oDstList))
        print("/!\ Warning - remplacer le dernier point par la valeur du premier point pour garantir un polygone fermé !")
        return

    def ctrlZone(self, oZone) -> None:
        if isinstance(oZone, list):
            aArray = oZone
        elif isinstance(oZone, dict):
            if oZone["type"] in ["Point","LineString"]:
                return
            if oZone["type"] == "Polygon":
                aArray = oZone["coordinates"][0]
            else:
                raise Exception("Unqualified type of area")
        else:
            return
        if aArray[0] != aArray[-1]:
            sHeader = "[" + bpaTools.getFileName(__file__) + "." + self.setZone.__name__ + "()] "
            sMsg = "/!\ Area Error - firstPoint={0} != lastPoint={1}".format(aArray[0], aArray[-1])
            raise Exception(sHeader + sMsg)
        return
    
    def ctrlAreasRef(self) -> None:
        try:
            for sRef, oRef in self.AreasRef.items():
               self.ctrlZone(oRef[0])
            return
        except Exception as e:
            sHeader = "[" + bpaTools.getFileName(__file__) + "." + self.ctrlAreasRef.__name__ + "()] "
            sMsg = "/!\ Evaluation Error - AreaRef={0}".format(sRef)
            raise Exception(sHeader + sMsg + " / " + str(e))            
            
    def setZoneRef(self, oZoneRef) -> bool:
        if isinstance(oZoneRef, list):
            self.oGeoZoneRef = {"type":"Polygon", "coordinates":[oZoneRef]}
        elif isinstance(oZoneRef, dict):
            self.oGeoZoneRef = oZoneRef
           
        self.oShapeZoneRef = shape(self.oGeoZoneRef)
        return

    def setZone(self, oZone) -> None:
        self.ctrlZone(oZone)
        if isinstance(oZone, list):
            self.oGeoZone = {"type":"Polygon", "coordinates":[oZone]}
        elif isinstance(oZone, dict):
            self.oGeoZone = oZone
        else:
            self.oGeoZone = None
            self.oShapeZone = None
            return
            
        if len(self.oGeoZone["coordinates"])==0:
            self.oGeoZone = None
            self.oShapeZone = None
        else:
            self.oShapeZone = shape(self.oGeoZone)
        return

    #Renvoie True si :
    #   si la zone envoyée est incluse dans la zone de référence
    #   si la frontière ou l'intérieur de la zone envoyée se croise de quelque façon avec la zone de référence
    def isInclude(self, oZone=None, oZoneRef=None) -> bool:
        if oZone   !=None:      self.setZone(oZone)
        if oZoneRef!=None:      self.setZoneRef(oZoneRef)
            
        ###For control of areas ; use http://geojson.tools)
        #g = []
        #g.append({"type":"Feature", "properties": {}, "geometry":gZone})
        #g.append({"type":"Feature", "properties": {}, "geometry":self.oShapeZoneRef})
        #geojson = {"type": "FeatureCollection", "features":g}
        #print(str(geojson).replace(chr(39),chr(34)))         
        
        bWithin = self.oShapeZone.within(self.oShapeZoneRef)
        if not bWithin:
            bIntersects = self.oShapeZone.intersects(self.oShapeZoneRef)
        return bool(bWithin or bIntersects)

    def evalAreasRefInclusion(self, sName, oZone) -> dict:
        ret:dict = {}
        sRef:str = ""
        try:
            self.setZone(oZone)
            if self.oGeoZone == None:
                return ret
            for sRef, oRef in self.AreasRef.items():
                oRefZone        = oRef[0]
                sRefBaseInclude = oRef[1]
                if oRefZone==None:
                    bRet = True
                else:
                    bRet = self.isInclude(None, oRefZone)
                if bRet and sRefBaseInclude:        #Contrôle d'une acceptation par combinaison de référence
                    bRet = ret[sRefBaseInclude]
                ret.update({sRef:bRet})
            return ret
        except Exception as e:
            sHeader = "[" + bpaTools.getFileName(__file__) + "." + self.evalAreasRefInclusion.__name__ + "()] "
            sMsg = "/!\ Evaluation Error - AreaName={0} - AreaRef={1}".format(sName, sRef)
            raise Exception(sHeader + sMsg + " / " + str(e))            
        
        
